import React from 'react';
import UButton from './UButton';
// import Button from 'react-bootstrap/Button';
import './../style/UStyle.css'



export default class Home extends React.Component {

  render() {
    return (
      <div className="ml-5">
        <h1>Landing Page/Home Page</h1>
        <UButton variant="u-action" content="Sign Up" /> <br />
        <br />
        <UButton size="u-lg" variant="u-action" content="Make A Bid" /><br />
        <br />
        <UButton disabled size="u-lg" variant="u-action" content="Disabled" /><br />
        <br />
        <UButton centered variant="u-sign-in" content="Sign In" /><br />
      </div>
    )
  }
}
